"     <div class=\"reference\">",
"      Alade SL, Brown RE, and Paquet A Jr, \"Polysorbate 80 and E-Ferol Toxicity,\"",
"      <i>",
"       Pediatrics",
"      </i>",
"      , 1986, 77(4):593-7.",
"      <span class=\"pubmed-id\">",
"       [PubMed",
"       <a href=\"UTD.htm?0/55/884/abstract-text/3960626/pubmed\" id=\"3960626\" target=\"_blank\">",
"        3960626",
"       </a>",
"       ]",
"      </span>",
"     </div>",
"    </li>",
"    <li>",
"     <div class=\"reference\">",
"      Centers for Disease Control (CDC), \"Unusual Syndrome With Fatalities Among Premature Infants: Association With a New Intravenous Vitamin E Product,\"",
"      <i>",
"       MMWR Morb Mortal Wkly Rep",
"      </i>",
"      , 1984, 33(14):198-9.",
"      <span class=\"pubmed-id\">",
"       [PubMed",
"       <a href=\"UTD.htm?0/55/884/abstract-text/6423951/pubmed\" id=\"6423951\" target=\"_blank\">",
"        6423951",
"       </a>",
"       ]",
"      </span>",
"     </div>",
"    </li>",
"    <li>",
"     <div class=\"reference\">",
"      Kakkis ED, Muenzer J, Tiller GE, et al, &ldquo;Enzyme-Replacement Therapy in Mucopolysaccharidosis I,&rdquo;",
"      <i>",
"       N Engl J Med",
"      </i>",
"      , 2001, 344(3):182-8.",
"      <span class=\"pubmed-id\">",
"       [PubMed",
"       <a href=\"UTD.htm?0/55/884/abstract-text/11172140/pubmed\" id=\"11172140\" target=\"_blank\">",
"        11172140",
"       </a>",
