var title_f0_55_889="RA MTP erosions x-ray";
var content_f0_55_889=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=RADIOL%2F85831%7ERADIOL%2F85820&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=RADIOL%2F85831%7ERADIOL%2F85820&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 596px\">",
"   <div class=\"ttl\">",
"    Plain radiograph of metatarsophalangeal joint space narrowing and erosions in rheumatoid arthritis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 576px; height: 432px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The radiograph of the left foot in the AP projection demonstrates an erosion in the periarticular, marginal \"bare\" area of the joint of the 5th&nbsp;MTP joint and more subtle erosions at the 1st, 2nd, 3rd, and 4th MTPs&nbsp;(white arrows), characteristic of rheumatoid arthritis. Also present is joint space narrowing of the 1st and 2nd MTP joints (orange arrows).",
"    <div class=\"footnotes\">",
"     MTP: metatarsophalangeal",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Richard Waite, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Plain radiograph of normal left foot",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 379px; height: 597px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The normal radiograph&nbsp;of the left foot is from a 53-year-old female. The foot is shown in the AP (A), oblique (B), and lateral projections (C).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
