var title_f0_55_892="Surgical wound classification";
var content_f0_55_892=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F51272&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F51272&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Surgical wound classification",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Class I/Clean",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        An uninfected operative wound in which no inflammation",
"is encountered and the respiratory, alimentary, genital, or uninfected",
"urinary tract is not entered. In addition, clean wounds are primarily",
"closed and, if necessary, drained with closed drainage. Operative",
"incisional wounds that follow nonpenetrating (blunt) trauma should be",
"included in this category if they meet the criteria.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Class",
"II/Clean-Contaminated",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        An operative wound in which the respiratory,",
"alimentary, genital, or urinary tracts are entered under controlled",
"conditions and without unusual contamination. Specifically, operations",
"involving the biliary tract, appendix, vagina, and oropharynx are",
"included in this category, provided no evidence of infection or major",
"break in technique is encountered.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Class",
"III/Contaminated",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Open, fresh, accidental wounds. In addition, operations",
"with major breaks in sterile technique (eg, open cardiac massage) or",
"gross spillage from the gastrointestinal tract, and incisions in which",
"acute, nonpurulent inflammation is encountered are included in this",
"category.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Class",
"IV/Dirty-Infected",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Old traumatic wounds with retained devitalized tissue",
"and those that involve existing clinical infection or perforated",
"viscera. This definition suggests that the organisms causing",
"postoperative infection were present in the operative field before the",
"operation.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Garner JS. CDC guideline for prevention of surgical wound infections, 1985. Supercedes guideline for prevention of surgical wound infections published in 1982. (Originally published in 1995). Revised. Infect Control 1986; 7:193.",
"     <br>",
"      Simmons BP. Guideline for prevention of surgical wound infections. Infect Control 1982; 3:185.",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
