var title_f0_55_893="ICD-10 Criteria HKD";
var content_f0_55_893=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F53723&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F53723&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    International classification of disease (10th edition) diagnostic criteria for hyperkinetic disorder",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Inattentive symptoms (at least six)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Often fails to give close attention to details, or makes careless errors in school work, work or other activities.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Often fails to sustain attention in tasks or play activities.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Often appears not to listen to what is being said to him or her.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Often fails to follow through on instructions or to finish",
"school work, chores, or duties in the workplace (not because of",
"oppositional behavior or failure to understand instructions).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Is often impaired in organizing tasks and activities.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Often avoids or strongly dislikes tasks, such as homework, that require sustained mental effort.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Often loses things necessary for certain tasks and activities, such as school assignments, pencils, books, toys or tools.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Is often easily distracted by external stimuli.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Is often forgetful in the course of daily activities.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Hyperactive symptoms (at least three)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Often fidgets with hands or feet or squirms on seat.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Leaves seat in classroom or in other situations in which remaining seated is expected.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Often runs about or climbs excessively in situations in which it is inappropriate (in adolescents or adults, only feelings of restlessness may be present).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Is often unduly noisy in playing or has difficulty in engaging quietly in leisure activities.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Exhibits a persistent pattern of excessive motor activity that is not substantially modified by social context or demands.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Impulsivity symptoms",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Often blurts out answers before questions have been completed.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Often fails to wait in lines or await turns in games or group situations.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Often interrupts or intrudes on others (eg butts into others' conversations or games).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Often talks excessively without appropriate response to social constraints.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Additional criteria",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        At least six inattentive symptoms, three hyperactive symptoms, and one impulsivity symptom, have persisted for at least six months, to a degree that is maladaptive and inconsistent with the developmental level of the child.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Onset of the disorder is no later than the age of seven years.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Criteria should be met for more than one setting (eg, at home and school).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        The symptoms cause clinically significant distress or impairment in social, academic, or occupational functioning.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        The patient does not meet criteria for pervasive",
"developmental disorders, manic episode, depressive episode, or anxiety",
"disorders.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from International Statistical Classification of Diseases and Related Health Problems (ICD-10), 10th edition, American Psychiatric Association, 1992.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
